import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png';
import './Logo.css'

const Logo = () => {
    return (
        <div className='ma3 mt10'>
            <Tilt className="Tilt br2 shadow-2" options={{ max : 50 }} style={{ position: 'absolut', left: '0px', top: '0px', height: 150, width: 150 }} >
                <span className="Tilt-inner pa2">
                    <img style={{ paddingTop: '10px' }}alt='' src={brain} />
                </span>
            </Tilt>
        </div>
    );
}

export default Logo;
